import './App.css';
import CollectionCard from './components/CollectionCard';
import Header from './components/Header';
import{ useState, useEffect }  from 'react';
import axios from 'axios';


function App() { 
let [zetaVerseData, setZetaVerseData] = useState(0);

  useEffect(() => {
    const getMyNfts = async () => {
      const openseaData = await axios.get('https://testnets-api.opensea.io/assets', {
        params: {
          asset_contract_address: '0x01df5ae7Ee67a583116De8ff53f6954871784FD4',
          order_direction: 'asc'
        }
      })
      .then(response => {
        // handle the response here
        console.log(response.data);
      })
      .catch(error => {
        // handle the error here
        console.error(error);
      });
      setZetaVerseData(openseaData.data.assets)
    }
      //return getMyNfts()
    }, [])




  return (
    <div className='app'>
    <Header />
    <CollectionCard 
    id={0} 
    name={'ZetaVerse'} 
    traits={[{'value': 7}]} 
    image='https://i.seadn.io/gae/SuPXcvDKA_rp9mcYJzxtrT-Wy_6aGFrs8G0J3ZJXdZ6zmSkkKqjVIHWcm0s6ZzPOXu-i7CnuiN36ZP4_JEe1FLVw2aa_IwR2Gpop2w?auto=format&w=1000'
    />
    <zetaverse zetaversedata={zetaversedata}/>
    </div>
  )

}

export default App;
